import React from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";

const PlannerTableRow = (props) => {

    const spendingCat = Object.keys(props.spending).map((catKey) => {
        return props.spending[catKey]
    });

    console.log(spendingCat)

    return (
        < tr className="hover:bg-gray-100 transition-all ease-linear duration-200 cursor-pointer" >

            <td className="w-1/2 whitespace-no-wrap border-b border-gray-200">
                <Link className="block px-8 py-4" to={`/budget/${spendingCat.name}`}>
                    <div className="text-sm leading-5 text-gray-900 font-semibold">
                        {spendingCat.name}
                    </div>
                </Link>
            </td>

            <td className="w-1/2 whitespace-no-wrap border-b border-gray-200">
                <Link className="block px-8 py-4" to={`/budget/${spendingCat.name}`}>
                    <div className="text-sm leading-5 text-gray-900 font-semibold">
                        {spendingCat.spent}
                    </div>
                </Link>
            </td>



        </tr >
    );
}

PlannerTableRow.propTypes = {
    project: PropTypes.object,
};

export default PlannerTableRow;
